  `tel` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `idquartier` int DEFAULT NULL,
  `longitude` double DEFAULT NULL,
  `latitude` double DEFAULT NULL,
  `longitude1` double DEFAULT NULL,
  `latitude1` double DEFAULT NULL,
  `longitude2` double DEFAULT NULL,
  `latitude2` double DEFAULT NULL,
  PRIMARY KEY (`idcontrat_site`),
  KEY `fk_contratsite_contrat_idx` (`idcontrat`),
  KEY `fk_contratsite_quartier_idx` (`idquartier`),
  CONSTRAINT `fk_contratsite_contrat` FOREIGN KEY (`idcontrat`) REFERENCES `contrat` (`idcontrat`) ON DELETE CASCADE,
  CONSTRAINT `fk_contratsite_quartier` FOREIGN KEY (`idquartier`) REFERENCES `quartier` (`idquartier`) ON UPDATE CASCADE
